import { Button, FormGroup, TextField, Box } from "@mui/material";

const Paper = (props) => {
  return (
    <div
      sx={{
        border: "1px solid #E6E7E9",
        borderRadius: "10px",
        height: props.height,
        maxHeight : 707,
        background: "#FFFFFF",
        width: "100%",
        minWidth : 440,
        overflow : 'auto',
        ...props.sx
      }}
    >
      {props.children}
    </div>
  );
};

export default Paper;
